import React from 'react';

function App() {

  const array = [{
    name:'Sanjana',
    age:'25',
    username:'sanj31'},
    {name:"mansih",
    age:'25',
    username:'manish@93'},];

}

const Array = props =>{
  return(
    <div>
      <p>{props.name}</p>
      <p>{props.age}</p>
      <p>{props.username}</p>
    </div>
  );
};

Array.propTypes = {
  name: React.propTypes.string,
  age:React.propTypes.string,
  username:React.PropTypes.string
}

const arr = props => {
  const array = props.quotes.map((array) => {
    return (
      <Array name={array.name} age={array.age} />
    );
  });
  return (
    <div>
      <h2>List of array</h2>
      {arr}
    </div>
  );
};
App.propTypes = {
  array: React.PropTypes.array
}

export default App;
